function StartScreen({ questionsLength, callback }) {
  return (
    <div className="start">
      <h2>Welcome to The React Quiz!</h2>
      <h3>{questionsLength} questions to test your React mastery</h3>
      <button
        className="btn"
        onClick={() => {
          callback({
            type: "start",
          });
        }}
      >
        Let's Start
      </button>
    </div>
  );
}

export default StartScreen;
